// src/pages/employee/MyProfilePage.js

import React from 'react';

const MyProfilePage = () => {
  return (
    <div className="container page">
      <h2>My Profile</h2>
      <p>This page will display the employee's personal and job information.</p>
    </div>
  );
};

export default MyProfilePage;
